namespace rng
{
	//use x as the seed for the rng
	extern inline thread_local unsigned long x = 
		((__rdtsc() *
			(__popcnt64(__rdtsc()) + 1234) *
			(unsigned long long)capture_iteration_count) ^
			0xABCDABCDABCD) ^
		__rdtsc() ^
		(int)"lol" ^
		(((long long)"zaba") << 32) 



		, y = 362436069, z = 521288629;
	extern inline unsigned long rng()
	{
		x ^= x << 16;
		x ^= x >> 5;
		x ^= x << 1;

		unsigned long t = x;
		x = y;
		y = z;
		z = t ^ x ^ y;

		return z;
	}
}




